import React, { Component } from "react";
import './index.css';
import './App.css';

export default class TimeCountDisplay extends Component {
    render() {
        return (
            <div>
                {this.props.timeCountlist.map(img =>
                    <img src={this.props.timeCountList} alt="blah" class="mini_pics" />)
                }
            </div>
        )
    }
}
